INSERT INTO "forum_threads" VALUES (9,'U.S. Reward: $10 Million for Info on Conti Leaders; $5 Million for Participants','<p>The Department of State is offering a reward of up to $10,000,000 for information leading to the identification and/or location of any individual(s) who hold a key leadership position in the Conti ransomware variant transnational organized crime group.&nbsp; In addition, the Department is also offering a reward of up to $5,000,000 for information leading to the arrest and/or conviction of any individual in any country conspiring to participate in or attempting to participate in a Conti variant ransomware incident.<br />
<br />
The Conti ransomware group has been responsible for hundreds of ransomware incidents over the past two years.&nbsp; The FBI estimates that as of January 2022, there had been over 1,000 victims of attacks associated with Conti ransomware with victim payouts exceeding $150,000,000, making the Conti Ransomware variant the costliest strain of ransomware ever documented.&nbsp; In April 2022, the group perpetrated a ransomware incident against the Government of Costa Rica that severely impacted the country&rsquo;s foreign trade by disrupting its customs and taxes platforms.&nbsp; In offering this reward, the United States demonstrates its commitment to protecting potential ransomware victims around the world from exploitation by cyber criminals.&nbsp; We look to partner with nations willing to bring justice for those victims affected by ransomware.<br />
<br />
This reward is offered under the Department of State&rsquo;s Transnational Organized Crime Rewards Program (TOCRP).<br />
<br />
The Department manages the TOCRP in close coordination with our federal law enforcement partners as part of a whole of government effort to disrupt and dismantle transnational organized crime globally, including cybercrime.&nbsp; More than 75 transnational criminals and major narcotics traffickers have been brought to justice under the TOCRP and the Narcotics Rewards Program (NRP) since 1986.&nbsp; The Department has paid more than $135 million in rewards under these programs to date.<br />
<br />
For more information on the group listed above and the TOCRP, please see&nbsp;<a href="https://www.state.gov/transnational-organized-crime-rewards-program-2/" target="_blank">Department of State INL Transnational Organized Crime Rewards.</a><br />
<br />
<br />
Source: <a href="https://www.state.gov/reward-offers-for-information-to-bring-conti-ransomware-variant-co-conspirators-to-justice/" target="_blank">U.S. Department of State</a><br />
<br />
[url=https://www.state.gov/transnational-organized-crime-rewards-program-2/][/url]</p>
','10-05-2022 20:41:48',3,2);
