INSERT INTO "forum_threads" VALUES (36,'Microsoft Warns About Evolving Capabilities of Toll Fraud Android Malware Apps','<p>Microsoft has detailed the evolving capabilities of toll fraud malware apps on Android, pointing out its &quot;complex multi-step attack flow&quot; and an improved mechanism to evade security analysis.<br />
<br />
Toll fraud belongs to a category of billing fraud wherein malicious mobile applications come with hidden subscription fees, roping in unsuspecting users to premium content without their knowledge or consent.<br />
<br />
It&#39;s also different from other fleeceware threats in that the malicious functions are only carried out when a compromised device is connected to one of its target network operators.<br />
<br />
&quot;It also, by default, uses cellular connection for its activities and forces devices to connect to the mobile network even if a Wi-Fi connection is available,&quot; Dimitrios Valsamaras and Sang Shin Jung of the Microsoft 365 Defender Research Team said in an exhaustive analysis.<br />
<br />
&quot;Once the connection to a target network is confirmed, it stealthily initiates a fraudulent subscription and confirms it without the user&#39;s consent, in some cases even intercepting the one-time password (OTP) to do so.&quot;<br />
<br />
Such apps are also known to suppress SMS notifications related to the subscription to prevent the victims from becoming aware of the fraudulent transaction and unsubscribing from the service.<br />
<br />
At its core, toll fraud takes advantage of the payment method which enables consumers to subscribe to paid services from websites that support the Wireless Application Protocol (WAP). This subscription fee gets charged directly to the users&#39; mobile phone bills, thus obviating the need for setting up a credit or debit card or entering a username and password.<br />
<br />
&quot;If the user connects to the internet through mobile data, the mobile network operator can identify him/her by IP address,&quot; Kaspersky noted in a 2017 report about WAP billing trojan clickers. &quot;Mobile network operators charge users only if they are successfully identified.&quot;<br />
<br />
Optionally, some providers can also require OTPs as a second layer of confirmation of the subscription prior to activating the service.<br />
<br />
&quot;In the case of toll fraud, the malware performs the subscription on behalf of the user in a way that the overall process isn&#39;t perceivable,&quot; the researchers said. &quot;The malware will communicate with a [command-and-control] server to retrieve a list of offered services.&quot;<br />
<br />
It achieves this by first turning off Wi-Fi and turning on mobile data, followed by making use of JavaScript to stealthily subscribe to the service, and intercepting and sending the OTP code (if applicable) to complete the process.<br />
<br />
The JavaScript code, for its part, is designed to click on HTML elements that contain keywords such as &quot;confirm,&quot; &quot;click,&quot; and &quot;continue&quot; to programmatically initiate the subscription.<br />
<br />
Upon a successful fraudulent subscription, the malware either conceals the subscription notification messages or abuses its SMS permissions to delete incoming text messages containing information about the subscribed service from the mobile network operator.<br />
<br />
Toll fraud malware is also known to cloak its malicious behavior by means of dynamic code loading, a feature in Android that allows apps to pull additional modules from a remote server during runtime, making it ripe for abuse by malicious actors.<br />
<br />
From a security standpoint, this also means that a malware author can fashion an app such that the rogue functionality is only loaded when certain prerequisites are met, effectively defeating static code analysis checks.<br />
<br />
&quot;If an app allows dynamic code loading and the dynamically loaded code is extracting text messages, it will be classified as a backdoor malware,&quot; Google lays out in its developer documentation about potentially harmful applications (PHAs).<br />
<br />
With an install rate of 0.022%, toll fraud apps accounted for 34.8% of all PHAs installed from the Android app marketplace in the first quarter 2022, ranking second below spyware. Most of the installations originated from India, Russia, Mexico, Indonesia, and Turkey.<br />
<br />
To mitigate the threat of toll fraud malware, it&#39;s recommended that users install applications only from the Google Play Store or other trusted sources, avoid granting excessive permissions to apps, and consider upgrading to a new device should it stop receiving software updates.</p>
','23-07-2022 19:24:13',3,1);
